from odoo import api, fields, models, _
from odoo.exceptions import UserError

import io
import logging
import base64

from ..libs.billzone.billzone import Billzone

_logger = logging.getLogger(__name__)

"""
    PDF jelentések felülírása
    
    A cél, hogy felülírjuk az összes PDF kimentetet az összes olyan Naplónál (journal),
    ahol be van kapcsolva a BillZone integráció.
    
    Helyek:
        - Adminisztrációs felület
        - Levél kommunikáció
        - Ügyfél portál
        
    A PDF állományok generálásához ezt az osztályt manipuláljuk:    
        - https://github.com/odoo/odoo/blob/8f4b98e67fe49516c0c830524de351db67c58357/odoo/addons/base/models/ir_actions_report.py
        
    Különösen ügyelünk arra, hogy kizárólag csak az arra vonatkozó kimeneteket írjuk
    felül és a többit ne!
"""

class billzone_ir_actions_report(models.Model):
    _inherit = 'ir.actions.report'

    """
        Letöltjük API-n keresztül a számlaképet
    """
    def billzone_pdf_download(self, invoice, bytes=False):
        if invoice.BillzoneCustomPDFEnable is True:
            return base64.b64decode(invoice.BillzoneCustomPDF)
        else:
            if invoice.BillzoneInvoiceNo:
                config_parameter = self.env['ir.config_parameter'].sudo()
                billzone = Billzone(config_parameter=config_parameter)
                response = billzone.download_invoice(InvoiceNumber=invoice.BillzoneInvoiceNo, DocumentType="PDF")
                if response['QueryResult']['InvoiceDocument']:
                    if bytes == True:
                        return io.BytesIO(response['QueryResult']['InvoiceDocument'])
                    else:
                        return response['QueryResult']['InvoiceDocument']
                else:
                    # Hiba történt
                    return base64.b64decode('')
            else:
                # A számla még nem elérhető PDF
                return base64.b64decode('')

    @api.multi
    def _post_pdf(self, save_in_attachment, pdf_content, res_ids):
        for record in self:
            if record.model == "account.invoice":
                invoice = self.sudo().env['account.invoice'].browse(res_ids)[0]
                if invoice.journal_id.BillzoneEnable == True:
                    if invoice.type in ('out_invoice', 'out_refund'):
                        if pdf_content:
                            pdf_content = self.billzone_pdf_download(invoice, bytes=False)
            return super(billzone_ir_actions_report, self)._post_pdf(save_in_attachment=save_in_attachment,
                                                                 pdf_content=pdf_content, res_ids=res_ids)

    @api.multi
    def render_qweb_pdf(self, res_ids=None, data=None):
        for record in self:
            if record.model == "account.invoice":
                invoice = self.sudo().env['account.invoice'].browse(res_ids)[0]
                if invoice.journal_id.BillzoneEnable == True:
                    if invoice.type in ('out_invoice', 'out_refund'):
                        pdf_content = self.billzone_pdf_download(invoice, bytes=False)
                        return pdf_content, "pdf"
            return super(billzone_ir_actions_report, self).render_qweb_pdf(res_ids=res_ids, data=data)
